import React from 'react';

const JobCard = ({ job }) => {
  return (
    <div className="job-card">
      <h2 className="job-title">{job.title}</h2>
      <p className="company-name">{job.company}</p>
      {/* Add other job card content elements */}
      <img
        className="location-image"
        src="location.png" // Replace with the actual image source
        alt="Location"
      />
      <p className="location-text">{job.location}</p>
      <p className="salary-range">{job.salary}</p>
      <p className="experience">{job.experience}</p>
      <button className="apply-button">Apply</button>
      <button className="save-button">Save</button>
      {/* Add other job card content elements */}
    </div>
  );
};

export default JobCard;
